      let url = `/api/check_membership?flight_id=${flightId}`;
      if (returnFlightId) {
        url += `&return_flight_id=${returnFlightId}`;
      }
      const response = await fetch(url, {
        headers: {
          "Accept": "application/json"
        }
      });
      if (!response.ok) {
        this.missingAirlines = [];
        return true;
      }
      const data2 = await response.json();
